import {$authHost} from "./index";

export const addRopes = async (order, brandName) => {
    try {
        const addBrandName = await $authHost.post('api/ropes/addRopeBrand', {brandName});
        const addRopesOrder = await $authHost.post('api/ropes/addRopesItems', {order, brandId: addBrandName.data.id});
    } catch (e) {
        console.log(e.message);
    }
}
